// 인자를 받는 StartUp 함수
void Ending_Image(int messageNumber) {
    // 콘솔 출력을 UTF-8로 설정
    UINT originalCP = GetConsoleOutputCP(); // 원래의 문자열 출력 방식 저장
    SetConsoleOutputCP(CP_UTF8); // 문자열 출력 형식 UTF-8 형식으로 변경

    // 번호에 따른 메시지 출력
    std::cout << getMessageByNumber(messageNumber) << std::endl;

    // 유니코드 문자열 여러 줄 출력
    std::cout << u8R"(⠀ )" << std::endl;

    // 원래의 출력 방식으로 복원
    SetConsoleOutputCP(originalCP);
}